import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../../context/AuthContext';
import { reviewAPI, enquiryAPI, instituteAPI } from '../../services/api';

const UserDashboard = () => {
  const [userData, setUserData] = useState({
    reviews: [],
    enquiries: [],
    recentInstitutes: []
  });
  const [loading, setLoading] = useState(true);
  const { user } = useAuth();

  useEffect(() => {
    fetchUserData();
  }, []);

  const fetchUserData = async () => {
    try {
      // In a real app, you would have specific endpoints for user data
      // For now, we'll use mock data
      setUserData({
        reviews: [
          { _id: 1, institute: { name: 'Delhi Public School' }, rating: 5, reviewText: 'Excellent school!', createdAt: new Date() },
          { _id: 2, institute: { name: 'St. Xavier\'s College' }, rating: 4, reviewText: 'Great campus life', createdAt: new Date() }
        ],
        enquiries: [
          { _id: 1, institute: { name: 'Aakash Institute' }, message: 'Looking for JEE coaching', status: 'responded', createdAt: new Date() }
        ],
        recentInstitutes: [
          { _id: 1, name: 'IIT Delhi', category: 'university', avgRating: 4.8 },
          { _id: 2, name: 'Amity University', category: 'university', avgRating: 4.2 }
        ]
      });
    } catch (error) {
      console.error('Error fetching user data:', error);
    } finally {
      setLoading(false);
    }
  };

  const renderStars = (rating) => {
    return Array.from({ length: 5 }, (_, index) => (
      <span key={index} className={index < rating ? 'star filled' : 'star'}>
        {index < rating ? '‚≠ê' : '‚òÜ'}
      </span>
    ));
  };

  if (loading) {
    return <div className="loading">Loading your dashboard...</div>;
  }

  return (
    <div className="user-dashboard">
      <div className="container">
        <div className="dashboard-header">
          <h1>Welcome back, {user.name}!</h1>
          <p>Here's your learning journey overview</p>
        </div>

        <div className="dashboard-stats">
          <div className="stat-card">
            <div className="stat-icon">‚≠ê</div>
            <div className="stat-info">
              <h3>{userData.reviews.length}</h3>
              <p>Reviews Written</p>
            </div>
          </div>
          <div className="stat-card">
            <div className="stat-icon">üí¨</div>
            <div className="stat-info">
              <h3>{userData.enquiries.length}</h3>
              <p>Enquiries Sent</p>
            </div>
          </div>
          <div className="stat-card">
            <div className="stat-icon">üè´</div>
            <div className="stat-info">
              <h3>{userData.recentInstitutes.length}</h3>
              <p>Institutes Viewed</p>
            </div>
          </div>
        </div>

        <div className="dashboard-content">
          <div className="content-row">
            {/* Recent Reviews */}
            <div className="content-card">
              <div className="card-header">
                <h3>Your Recent Reviews</h3>
                <Link to="/institutes" className="btn btn-outline btn-sm">
                  Browse More
                </Link>
              </div>
              
              <div className="reviews-list">
                {userData.reviews.length === 0 ? (
                  <div className="empty-state">
                    <p>You haven't written any reviews yet.</p>
                    <Link to="/institutes" className="btn btn-primary">
                      Write Your First Review
                    </Link>
                  </div>
                ) : (
                  userData.reviews.map(review => (
                    <div key={review._id} className="review-item">
                      <div className="review-header">
                        <h4>{review.institute.name}</h4>
                        <div className="review-rating">
                          {renderStars(review.rating)}
                        </div>
                      </div>
                      <p className="review-text">{review.reviewText}</p>
                      <span className="review-date">
                        {new Date(review.createdAt).toLocaleDateString()}
                      </span>
                    </div>
                  ))
                )}
              </div>
            </div>

            {/* Recent Enquiries */}
            <div className="content-card">
              <div className="card-header">
                <h3>Your Enquiries</h3>
              </div>
              
              <div className="enquiries-list">
                {userData.enquiries.length === 0 ? (
                  <div className="empty-state">
                    <p>You haven't sent any enquiries yet.</p>
                  </div>
                ) : (
                  userData.enquiries.map(enquiry => (
                    <div key={enquiry._id} className="enquiry-item">
                      <div className="enquiry-header">
                        <h4>{enquiry.institute.name}</h4>
                        <span className={`status ${enquiry.status}`}>
                          {enquiry.status}
                        </span>
                      </div>
                      <p className="enquiry-message">{enquiry.message}</p>
                      <span className="enquiry-date">
                        {new Date(enquiry.createdAt).toLocaleDateString()}
                      </span>
                    </div>
                  ))
                )}
              </div>
            </div>
          </div>

          {/* Recommended Institutes */}
          <div className="content-card full-width">
            <div className="card-header">
              <h3>Recommended Institutes</h3>
              <Link to="/institutes" className="btn btn-outline btn-sm">
                View All
              </Link>
            </div>
            
            <div className="institutes-grid">
              {userData.recentInstitutes.map(institute => (
                <div key={institute._id} className="institute-card">
                  <Link to={`/institute/${institute._id}`} className="card-link">
                    <div className="card-image">
                      <div className="image-placeholder">üè´</div>
                    </div>
                    
                    <div className="card-content">
                      <h4>{institute.name}</h4>
                      <p className="category">{institute.category}</p>
                      
                      {institute.avgRating > 0 && (
                        <div className="rating">
                          <span className="stars">‚≠ê</span>
                          <span>{institute.avgRating}</span>
                        </div>
                      )}
                    </div>
                  </Link>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserDashboard;
